  return {
    restrict: 'A',
    require: {
      ngModel: 'ngModel',
      form: '^?form',
      ngModelOptions: '^?ngModelOptions'
    },
    controller: NgModelController,
    link: {
      pre: function(scope, element, attr, ctrls) {
        // Pass the ng-model-options to the ng-model controller
        if (ctrls.ngModelOptions) {
